import React, {Component, Fragment} from "react";
import Challenges from "./challenges.json";

class TeamDash extends Component{

    componentDidMount() {
        console.log(Challenges);
        let key = Challenges.id;
    }

    render(){
        return (
            <Fragment>
                <div className="page-header">
                    <h5>Team Dashboard</h5>
                </div>

                {Challenges.map( key => 
                    <div key={Challenges.id} id={Challenges.id} className="challenge-div">
                        <h5>{Challenges.title}</h5>
                        <p>{Challenges.description}</p>
                    </div>
                        // <p key={key} className="chat-messages">
                        // <b>{this.state.chatHistory[key].teamName + ": "}</b>{this.state.chatHistory[key].text} 
                        // </p>

                    )}
                <p>THIS IS THE TEAM DASHBOARD PAGE!!</p>
            </Fragment>
        )
    }


}//End TeamDash Component

export default TeamDash;
